●ＥＬＥＣＯＭ共同企画　ＬＡＮケーブル５本パック<br>●着脱安心な「ツメの折れないコネクタ」と「ツメ折れ防止カバー」のＷ構造。<BR>●カテゴリー５Ｅ対応<BR>●ケーブルは柔らかいヨリ線仕様なので、無理な曲げによる断線が少なく、取り回しが楽です。<BR>●ゴミを減らす簡易パッケージ仕様<BR>●ＰｏＥ対応製品で利用が可能です。<br>●仕様／カテゴリー５Ｅ対応（ツメ折れ防止タイプ）、ヨリ線（８芯）・ストレート<BR>●規格／１０ＢＡＳＥ－Ｔ、１００ＢＡＳＥ－ＴＸ、１０００ＢＡＳＥ－Ｔ<BR>●色／ブラック<BR>●長さ／２．０ｍ<BR>●ケーブル太さ／５．３５ｍｍ<BR>●１パック＝５本入<BR>※簡易パッケージ仕様<BR>●ＥＵ　ＲｏＨＳ指令準拠<br>●メーカー／オリジナル<br>●型番／TTBK2EX5TA<br>●JANコード／4953103604711<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

